\u0022\u0025\u006b\u005a\u0060\u0037\u0076\u006c\u0073\u0052\u0025\u002f\u0057\u002f\u0056\u005a\u0025\u005f\u0069\u006f\u0058\u0028\u002a\u007e\u0031\u0046\u002b\u004d\u0072\u0063\u0046\u0045\u007e\u0054\u0074\u0037\u0057\u004f\u003c\u002e\u0048\u0024\u003f\u002e\u0045\u0044\u006e\u0068\u0047\u0079\u004e\u002e\u003d\u005e\u002b\u0064\u0075\u0043\u002c\u0055\u0045\u0062\u0042\u0054\u0079\u0057\u0074\u007e\u0067\u0071\u0073\u007c\u0031\u0062\u0030\u006d\u0053\u0064\u004e\u0074\u0023\u0042\u002c\u0069\u0021\u0058\u0035\u007e\u0055\u0071\u003f\u004a\u0066\u0061\u002a\u003c\u0021\u0079\u0068\u0043\u007e\u0021\u0048\u0024\u0068\u003c\u0032\u0060\u004f\u002b\u0042\u0044\u0025\u004e\u006f\u0021\u0053\u005f\u0051\u006e\u007d\u004c\u007e\u004d\u0072\u0060\u0050\u0074\u0023\u004e\u0069\u0041\u0065\u0074\u003c\u0049\u0029\u0033\u007e\u0039\u0047\u0057\u0055\u0052\u006a\u0045\u0034\u0052\u0069\u0079\u004b\u005d\u0025\u0064\u0045\u0026\u0069\u003b\u006e\u007c\u005e\u004d\u0069\u0024\u0067\u0067\u006c\u0024\u0068\u0063\u002c\u005a\u0072\u0021\u0046\u007d\u0044\u004f\u006f\u0071\u007b\u0071\u0043\u0023\u0056\u0062\u0038\u0047\u007a\u0071\u0076\u0024\u0051\u0074\u005d\u0038\u003e\u0029\u002a\u0063\u007d\u006d\u002c\u0030\u0058\u0057\u0042\u002a\u0025\u0056\u006f\u0021\u0053\u0060\u0051\u0048\u0029\u0032\u0074\u0026\u003a\u0032\u004f\u002c\u0079\u003e\u007e\u0069\u0023\u003a\u002b\u0039\u007a\u002c\u0032\u0034\u002b\u0057\u0042\u0073\u0079\u0076\u002c\u006b\u0058\u0023\u0064\u004e\u006a\u0074\u002c\u0077\u0038\u0060\u0061\u005b\u0079\u003d\u0068\u0037\u0036\u0049\u003a\u0075\u003b\u0032\u0074\u0026\u003a\u0032\u004f\u002c\u0079\u003e\u007e\u0069\u0023\u003a\u002b\u0039\u007a\u007e\u003c\u0067\u0038\u002b\u0042\u0078\u005e\u006e\u002c\u0063\u0053\u0029\u002a\u0073\u007d\u0061\u007e\u004c\u0053\u0070\u006e\u005b\u0055\u0058\u0031\u0059\u003c\u0038\u004d\u006d\u007b\u0067\u0025\u0070\u003d\u0062\u0046\u002c\u0028\u0049\u002c\u006b\u0058\u0041\u0077\u0075\u006a\u0063\u002c\u0067\u0038\u002b\u0042\u0063\u007d\u005a\u0062\u0070\u0040\u003b\u002f\u0023\u007a\u005b\u0062\u0075\u0039\u0063\u0057\u0065\u0050\u006d\u006e\u004c\u007e\u0026\u002f\u0072\u006a\u0057\u0034\u004b\u003a\u005e\u0073\u0064\u0023\u005f\u0069\u006d\u0053\u0042\u0065\u003a\u007d\u0063\u002c\u0038\u0072\u004f\u005a\u0024\u0055\u0068\u0034\u0051\u0045\u003a\u0035\u0051\u0033\u0036\u0026\u004c\u003d\u004f\u0051\u002f\u0051\u0036\u0024\u003a\u006e\u0036\u0051\u0075\u006a\u0037\u0026\u0061\u003a\u005e\u0073\u0058\u0070\u007a\u0074\u0072\u0053\u0038\u0023\u003f\u0068\u0052\u0070\u003b\u003a\u0025\u0043\u0022\u0022\u0025\u006b\u005a\u0060\u0037\u0076\u006c\u0073\u0052\u0025\u002f\u0057\u002f\u0056\u005a\u0025\u005f\u0069\u006f\u0058\u0028\u002a\u007e\u0031\u0046\u002b\u004d\u0072\u0063\u0046\u006c\u0057\u0061\u0074\u0046\u0053\u0057\u0033\u0023\u007a\u005b\u0062\u0075\u0039\u0063\u0057\u0065\u0050\u006d\u006e\u004c\u007e\u0026\u002f\u0072\u006a\u0057\u0034\u004b\u003a\u005e\u0073\u0064\u0023\u005f\u0069\u006d\u0053\u0042\u0065\u003a\u007d\u0063\u002c\u0071\u0063\u004f\u005a\u0061\u003c\u0060\u0024\u006d\u0070\u005d\u0058\u0077\u0046\u007a\u0029\u0044\u0056\u0041\u0067\u0053\u002e\u0077\u0074\u0075\u0053\u0029\u002a\u0024\u0068\u0074\u0030\u0040\u004f\u006d\u0046\u0028\u005e\u0076\u002c\u006d\u0053\u002e\u005b\u0048\u005f\u007d\u0051\u007a\u0035\u007e\u0055\u0071\u003f\u004a\u0066\u0061\u002a\u003c\u0021\u0079\u0068\u0043\u007e\u002e\u0046\u003f\u0068\u0054\u007e\u0040\u004f\u005e\u0073\u0065\u0021\u0040\u0039\u007d\u0051\u0056\u0077\u0063\u007d\u0029\u0078\u0041\u0072\u006a\u0046\u0050\u0036\u0063\u0055\u0060\u006e\u004f\u0068\u0043\u0029\u005e\u0026\u005a\u0069\u006f\u0076\u0038\u002a\u006e\u0026\u0051\u0045\u003a\u0035\u0051\u0033\u0036\u0026\u004c\u003d\u004f\u0051\u002f\u0051\u0036\u0024\u003a\u006e\u0036\u0051\u0075\u006a\u0037\u0026\u0061\u003a\u005e\u0073\u0058\u0070\u007a\u0074\u0072\u0053\u0063\u0078\u0044\u0068\u0052\u0070\u003e\u0038\u0055\u004e\u0052\u006a\u0045\u0034\u0052\u0069\u0079\u004b\u005d\u0025\u0064\u0045\u0026\u0069\u003b\u006e\u0029\u0044\u007d\u0069\u0024\u0067\u004e\u006c\u003a\u007d\u0033\u0026\u0044\u004b\u0075\u0046\u0064\u007d\u0063\u002c\u0062\u0032\u0071\u0043\u0023\u0056\u0062\u0038\u0047\u007a\u0071\u0076\u0024\u0051\u0074\u005d\u0055\u0053\u0079\u0043\u0069\u007d\u0033\u0026\u0046\u0072\u0067\u0042\u006d\u007d\u0024\u0047\u0070\u003e\u006d\u0046\u0074\u007a\u0032\u0074\u0026\u003a\u0032\u004f\u002c\u0079\u003e\u007e\u0069\u0023\u003a\u002b\u0039\u007a\u002c\u0032\u0034\u002b\u0057\u0042\u0073\u0079\u0076\u002c\u006b\u0058\u0023\u0064\u004e\u006a\u0074\u002c\u006d\u0053\u0070\u006e\u005b\u0055\u0058\u0031\u0059\u003c\u0038\u004d\u006d\u007b\u0067\u0025\u0070\u003d\u0062\u0046\u002c\u0028\u0049\u002c\u006b\u0058\u0041\u0077\u0075\u006a\u0063\u002c\u0067\u0038\u002b\u0042\u0063\u007d\u0063\u0068\u0070\u0040\u0074\u0046\u0053\u007a\u0023\u0032\u0039\u006f\u0026\u0046\u002e\u004a\u0061\u0074\u0043\u002b\u006b\u003c\u0028\u0048\u0059\u0030\u003a\u004f\u0026\u004e\u002c\u0030\u0035\u0041\u0040\u007b\u0071\u0043\u0023\u0056\u0062\u0038\u0047\u007a\u0071\u0076\u0024\u0051\u0074\u005d\u0055\u0053\u0079\u0043\u0069\u007d\u0033\u0026\u0046\u0072\u0067\u0042\u006d\u007d\u0024\u0047\u0070\u003e\u006d\u0046\u0059\u0056\u0059\u0030\u0029\u0050\u0026\u004e\u0042\u002e\u003d\u0062\u006d\u0032\u0056\u0029\u0055\u0021\u003d\u005d\u0047\u0069\u0055\u0067\u0044\u007d\u0061\u0074\u0055\u0067\u005a\u006c\u0024\u0068\u007a\u005d\u0022\u0058\u006f\u0073\u006a\u0023\u0063\u002c\u006c\u0075\u002e\u0046\u0063\u0033\u0022\u0068\u006c\u006f\u007a\u0058\u0055\u0074\u0070\u006a\u0041\u0032\u0055\u0063\u0056\u006a\u007c\u005d\u0075\u004f\u002b\u0042\u0054\u0079\u006d\u006f\u0057\u0057\u0041\u0046\u0063\u007d\u0063\u0023\u0069\u007a\u006d\u0046\u002e\u004a\u0061\u0074\u006b\u0067\u0054\u003c\u0067\u007a\u0035\u003f\u002e\u0045\u0044\u006e\u0068\u0047\u0079\u004e\u002e\u003d\u005e\u002b\u0064\u0075\u0043\u002c\u0055\u0045\u0062\u0042\u0054\u0079\u0057